import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class SinginComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      firstName: '',
      lastName: '',
      email: '',
      password1: '',
      password2: '',
    };

    this.handleChange = this.handleChange.bind(this);
    this.singinClicked = this.singinClicked.bind(this);
  }

  //* Check inputs for changes
  handleChange(event) {
    //* Find the right state and save content from input into state
    this.setState({
      [event.target.name]: event.target.value,
    });
  }

  singinClicked(event) {
    event.preventDefault();
    console.log(this.state.firstName);
  }

  render() {
    return (
      <section className="custom-card-singin">
        <div className="container">
          <h1 className="d-flex justify-content-center pb-4 pt-4">Sing In</h1>

          <div className="card">
            <div className="card-body">
              <form>
                {/* START First Name */}
                <div class="form-group pt-2">
                  <input
                    type="text"
                    name="firstName"
                    class="form-control"
                    aria-describedby="emailHelp"
                    placeholder="First Name"
                    required
                    onChange={this.handleChange}
                  />
                </div>
                {/* END First Name */}

                {/* START Last Name */}
                <div class="form-group pt-2 pb-2">
                  <input
                    type="text"
                    name="lastName"
                    class="form-control"
                    placeholder="Last Name"
                    required
                    onChange={this.handleChange}
                  />
                </div>
                {/* END Last Name */}

                {/* START Email */}
                <div class="form-group pt-2 pb-2">
                  <input
                    type="email"
                    name="email"
                    class="form-control"
                    placeholder="Email"
                    required
                    onChange={this.handleChange}
                  />
                </div>
                {/* END Email */}

                {/* START Password */}
                <div class="form-group pt-2 pb-2">
                  <input
                    type="password"
                    name="password1"
                    class="form-control"
                    placeholder="Password"
                    required
                    onChange={this.handleChange}
                  />
                </div>
                {/* END Password */}

                {/* START Password Repeat */}
                <div class="form-group pt-2 pb-2">
                  <input
                    type="password"
                    name="password2"
                    class="form-control"
                    placeholder="Repeat Password"
                    required
                    onChange={this.handleChange}
                  />
                </div>
                {/* END Password repeat*/}

                <button type="submit" class="btn btn-outline-danger" onClick={this.singinClicked}>
                  Sing in
                </button>

                <Link className="btn btn-link ml-5">
                  <small class="text-primary">Login</small>
                </Link>
              </form>
            </div>
          </div>
        </div>
      </section>
    );
  }
}
